import React from "react";
import Header from "./Header";

const App = () => {
  const categories = [
    "Category 1",
    "Category 2",
    "Category 3",
    "Category 4",
    "More",
  ];
  const socialMedia = [
    { name: "Instagram", icon: "instagram.png" },
    { name: "Facebook", icon: "facebook.png" },
  ];

  return (
    <div>
      <Header
        companyName="Company Name"
        categories={categories}
        socialMedia={socialMedia}
      />
      {/* Other components */}
    </div>
  );
};

export default App;
